$(document).ready(function() {

  // Telefono #
  $('.format-phone-number').formatter({
      pattern: '{{999}}-{{999}}-{{99}}{{99}}'
  });
    function  generarReporte(registros){
        var entrega=registros.entrega;
        var apellido=registros.cliente.apellido !==''?registros.cliente.apellido:'';
        var hoy = new Date();
        var dd = hoy.getDate();
        var mm = hoy.getMonth() + 1; //hoy es 0!
        var yyyy = hoy.getFullYear();
        var folio = registros.folio;
        if (folio < 10) {
            folio = '00000' + folio;
        }
        if (folio >= 10 && folio <= 99) {
            folio = '0000' + folio;
        }
        if (folio >= 100 && folio <= 999) {
            folio = '000' + folio;
        }
        if (folio >= 1000 && folio <= 9999) {
            folio = '00' + folio;
        }
        if (dd < 10) {
            dd = '0' + dd;
        }
        if (mm < 10) {
            mm = '0' + mm;
        }

        hoy = dd + '/' + mm + '/' + yyyy;
        console.log('voy a generar el reporte de MANTENIMINETO' + JSON.stringify(registros));
        var imageData='data:image/jpeg;base64,';
        var doc = new jsPDF('p', 'pt');
        doc.addImage(imageData, 'JPEG', 40, 100,520, 100);
        doc.setDrawColor(64, 128, 255);
        doc.setLineWidth(1.5);
        doc.setFillColor(64, 128, 255);
        doc.roundedRect(40, 30, 515, 20, 3, 3, 'FD');
        doc.roundedRect(40, 30, 515, 250, 3, 3, '');
        doc.setFontSize(14);
        doc.setFont('times');
        doc.setFontType('italic');
        doc.setTextColor(255, 255, 255);
        doc.text(50,45,'TICOMP  Tecnologia Informatica y Computo');
        doc.setFontSize(16);
        doc.setFont('helvetica');
        doc.setFontType('bold');
        doc.text(400,45,'Orden de Servicio');
        doc.setLineWidth(1.5);
        doc.line(40, 50, 555, 50);
        doc.setFontSize(14);
        doc.setTextColor(0, 0,0);
        doc.setFontSize(12);
        doc.setFont('courier');
        doc.setFontType('normal');
        doc.text(50,75,'NUMERO DE ORDEN:');
        doc.text(170,75,''+folio);
        doc.text(340,75,'FECHA DE RECEPCION:');
        doc.text(480,75,''+hoy);
        doc.text(310,95,'FECHA EST. DE ENTREGA: ');
        doc.text(480,95,''+entrega);
        doc.text(50,125,'CLIENTE: ');
        doc.text(115,125,registros.cliente.nombre!==''?registros.cliente.nombre+' '+apellido:'');
        doc.text(380,125,'TELEFONO:');
        doc.text(460,125,''+registros.cliente.telefono );
        var columns = ["Equipo", "Marca","Modelo","Num.Serie"];
        var equipo=[[''+registros.equipo.equipo,''+registros.equipo.marca,''+registros.equipo.modelo,''+registros.equipo.numeroSerie]];
        doc.autoTable(columns,equipo,{
            theme:"plain",
             headerStyles: {
               // fillColor: [64, 128, 255],
                //textColor: [255,255,255],asdfasdf
              halign: 'center'
            },
            bodyStyles: {halign:'center'},

            margin:{top:150


          },haling:'center'

        });
        doc.setFontSize(12);
        doc.setFont('courier');
        doc.setFontType('normal');
        doc.text(50,220,'DESCRIPCION DE LA FALLA:');
        doc.text(230,220,registros.falla!==''?registros.falla:'');
        doc.text(50,250,'ACCESORIOS Y CABLES ADICIONALES:');
        doc.text(300,250,registros.accesorios !==''?registros.accesorios:'');
        doc.save('G'+'-'+registros.cliente.nombre+'-'+folio+'.pdf');


    }

    $('#btn-registrarG').click(function(e) {

        e.preventDefault();
      console.log('estoy presionando el boton para registrar la garantia');
      var meses = ['ENERO', 'FEBRERO', 'MARZO', 'ABRIL', 'MAY0', 'JUNIO', 'JULIO', 'AGOSTO', 'SEPTIEMBRE', 'OCTUBRE', 'NOVIEMBRE', 'DICIEMBRE'];
      var hoy = new Date();
      var dd = hoy.getDate();
      var mm = hoy.getMonth() + 1; //hoy es 0!
      var yyyy = hoy.getFullYear();
      var indicemes = parseInt(mm);
      var mesnombre = meses[indicemes - 1];
      if (dd < 10) {
          dd = '0' + dd;
      }
      var garantia={
        cliente:$('#clienteG').val(),
        apellido:$('#apellidoC').val(),
        telefono:$('#telefonoG').val(),
        equipo:$('#equipoG').val(),
        marca:$('#marcaG').val(),
        modelo:$('#modeloG').val(),
        numSerie:$('#serieG').val(),
        falla:$('#descripcionG').val(),
        observaciones:$('#observacionesG').val(),
        accesorios:$('#accesoriosG').val(),
        entrega:$('.daterange-single').val(),
        dia: dd,
        mes: mesnombre,
        ao: yyyy

      };
    var route = "/addGarantia";
    $.ajax({
        url: route,
        method: 'POST',
        dataType: 'json',
        data: garantia,
        async: false,
        success: function(data) {
              console.log('se registro la garantia', data);
          if (data.error === false) {
              $("body").overhang({
                  type: "success",
                  message: data.message

              });
              $('#formGarantia').each(function() {
                  this.reset();
                  var validator = $( "#formGarantia" ).validate();
                  validator.resetForm();
              });
              generarReporte(data.garantia);
          } else {
              $("body").overhang({
                  type: "warn",
                  message: data.message,
                  duration: 3
              });
          }
        },error:function(err){
          $("body").overhang({
              type: "error",
              message: "OCURRIO UN ERROR AL REGISTRAR EL USUARIO VERIFIQUE SUS DATOS"
          });
        }
    });

    });
});
